import React, { Component } from 'react'

class TeacherProfile extends Component {
  displayColors = () => {
    return ["red", "orange", "green", "blue", "purple"].map((color, index) => {
      return (
        <div
          key={index}
          className={`select-color ${color}-title`}>
        </div>
      )
    })
  }

  render(){
    return (
    <div></div>
    )
  }
}

export default TeacherProfile
